import React from 'react'
import "./Home.css";
import {Container } from 'react-bootstrap';
import logosolaris from './logo.svg';

const Home = props => (
    <Container className="home">
        <img src={logosolaris} alt="Logo Solaris" className="logo" />
        <Container>
            'Bienvenido!
        </Container>
    </Container>
)

export default Home
